sovyetler yıkılmadan önce olmayan farktır. sovyetler zamanında her iki ülkenin kızı da onurlu, dimdik, güçlü ve özgür idi. şimdi ise, yarın için endişeleniyor, tüketim düzeninde yozlaşıyor veya borç batağında deli gibi çalışıyor.

illa ki bir versus istiyorsanız, o da şudur;

biri rusça, diğeri ukraynaca konuşur;

ama, her ikisi de kapitalist sistemde aynı kaderi paylaşır.
